  }

  get fromAddress() {
    return this.emailForm.get('fromAddress');
  }

  get subjectLine() {
    return this.emailForm.get('subjectLine');
  }

  get messageBody() {
    return this.emailForm.get('messageBody');
  }

  sendEmail() {
    if (this.emailForm.valid) {
